/**
 * Professional Certificate Template Generator
 * Creates certificates using the provided template image with positioned text overlays
 */

/**
 * Format certificate data for template generation
 * @param {Object} data - Raw certificate data
 * @returns {Object} - Formatted certificate data
 */
export const formatCertificateData = (data) => {
  // Format date from "8/22/2025" to "22 August 2025"
  const formatDate = (dateString) => {
    if (!dateString) return '';
    try {
      const date = new Date(dateString);
      const day = date.getDate();
      const month = date.toLocaleString('en-US', { month: 'long' });
      const year = date.getFullYear();
      return `${day} ${month} ${year}`;
    } catch (error) {
      return dateString; // Return original if parsing fails
    }
  };

  return {
    studentName: data.fullName || data.studentName || '',
    courseName: data.courseName || data.course_name || '',
    sessionDate: formatDate(data.dateString || data.sessionDate || ''),
    issuedDate: formatDate(data.issuedDate || data.date || ''),
    certificateId: data.certificateId || data.certificate_id || '',
    enrollmentId: data.enrollmentId || data.enrollment_id || '',
    instructorName: data.instructorName || data.instructor_name || '',
    coordinatorName: data.coordinatorName || data.coordinator_name || 'Neeraj Narain',
    qrCodeDataUrl: data.qrCodeDataUrl || '',
    sessionType: data.sessionType || 'Demo Session Attendance',
    instructorSignature: data.instructorSignature || '',
    coordinatorSignature: data.coordinatorSignature || ''
  };
};

